bool JS_registerClass(TiGlobalContextRef context, TiObjectRef parentObject,
                             const char* className,
                             TiClassDefinition* definition) {

    TiStringRef js_className = TiStringCreateWithUTF8CString(className);
    TiObjectRef classObject = TiObjectMake(context, TiClassCreate(definition), NULL);
    TiObjectSetProperty(context, parentObject,
                        js_className, classObject,
                        kTiPropertyAttributeNone, NULL);
    TiStringRelease(js_className);
    
    return true;
}

